import { Location } from "@angular/common";
import { Component } from "@angular/core";
import { CTF, CtfService } from "src/app/services/ctf.service";

import { Component } from "@angular/core";

@Component({
  selector: "app-ctf-edit",
  template: ` <p>ctf-edit works!</p> `,
  styles: [],
})
export class CtfEditComponent {}

@Component({
  selector: "app-ctf-list",
  template: `<div class="container" style="padding-top: 65px"><a class="btn btn-primary" (click)="newCTF()">New CTF</a>{{ ctfs }}</div>`,
  styles: [],
})
export class CtfListComponent {
  ctfs: CTF[] = [];

  constructor(private ctfService: CtfService, private location: Location) {}

  ngOnInit() {
    this.ctfService.getCTFs().subscribe((ctfs) => {
      this.ctfs = ctfs;
    });
  }

  newCTF() {
    this.location.go("/ctfs/new");
  }
}
